      "title": "Oozing with originality",
      "content": "This is a world where people can go into your dreams. Some are even able to use your dreams to influence your actions. Dom Cobb (Leonardo DiCaprio) is skilled at stealing secrets by diving into your dreams. It's a dark treacherous world where he has made too many enemies. Now he is offered a chance to come in from the cold. This time his team is tasked to plant an idea into the target's mind, or in one word inception.Christopher Nolan has created something of a Penrose-stairs structure in this movie. It's complicated and may be too convoluted to be reasonable. But that's as much part of its charm. The worlds, the effects, the ideas are all first rate. It is oozing with originality.The actors are also first rate. Nolan can command the best cast to his projects now. There is nobody better than DiCaprio to anchor this movie. Nothing about this movie is done with lesser parts. This is indeed a top movie."
