    {
      "username": "Horst_In_Translation",
      "userUrl": "https://www.imdb.com/user/ur3914439",
      "reviewLink": "https://www.imdb.com/review/rw6006550",
      "warningSpoilers": true,
      "date": "18 August 2020",
      "rate": "8",
      "helpful": "1 out of 5 found this helpful.",
      "title": "A deep dive into the human mind, Nolan at his finest",
      "content": "The word \"Inception\" will always be associated with this 2.5-hour movie we have here and that says it all basically about how defining the outcome is. But first things first: The writer and direcctor here is of course Christopher Nolan and his British/American production from 2010 is maybe still his defining effort ten years later. They are showing this in theaters now again for said tenth anniversary and I happily took the chance to give it another watch, my third in fact and it definitely was not worse than my first or second. This is the kind of film that is indeed a lot better to be seen on the big screen, not only, but also because of the special effects. This movie won four Oscars, so also a big success with awards bodies, especially because it took home 150 more awards and over 200 more nominations and that is just what is listed here on imdb. Still I remember many people outraged back then because the one thing it did not get was an Oscar nomination for Nolan himself as director despite getting in at pretty much every important precursor. However, now in 2020, he also has his director nod and for this film here he got the writing nomination at least and that is absolutely alright because I think that the writing is the film's best aspect probably. Utter genius involved here and even more impressive if it was Nolan all on his own apparently.No Oscar nominations for the cast here. I think the only one who was slightly considered was Marion Cotillard and I would have liked it. She was really good, but then again I am a fan of her anyway. But it wasn't meant to happen and that is perfectly fine. She has one trophy already anyway, also did back then, which maybe helped her also in terms of getting cast here. She is one of several cast members that have worked with Nolan on other occasions before or after this movie, even if I think her portrayal in the final Batman film did not receive such positive acclaim overall. Oh well, others would be Murphy, Hardy and of course Michael Caine, who only has very little screen time here, two scenes and his second scene only lasts for a few seconds, but the first is really nice when his character meets the protagonist. Then there's a few actors whose star has gone down a bit in the last 10 years since this movie was made. Murphy may fit the description too to some extent, but I mostly mean the younger folks like Joseph Gordon-Levitt and Ellen Page. And Pete Postlethwaite is already dead for a few years, a bit sad knowing that now with how we see his character here dying too. May he rest in peace. But speaking of JGL, his role here is a bit of an example why he would never make it big in Hollywood. His character so plays second fiddle to Leonardo DiCaprio that it was a bit embarrassing almost here and there and among the weaker components of the film. Take the very early part already how he is trying so hard to convince Watanabe's character, while Leo knows his value and is all smooth and cool. Or how JGL is the one being caught and used to put pressure on Cobb (Leo) and even gets a bullet in the head. Or how he falls from the chair, kicked by Hardy I think, to elaborate on another phenomenon how people wake up from dreams. Oh yes, Watanabe I mentioned. Him I liked and like in general as an actor. I wish his character could have had more screen time to be honest, but his injury got in the way, but as we were sliding down the spheres, he gets better again. Still a bit strange how he so effortlessly turns into good guy and part of the team while being the antagonist before that and also with no real knowledge on the subject accompanies the thieves in their crucial endeavor involving Murphy's character. He was not really needed though.Another character who becomes part of the gang is Ellen Page's. She had some good moments and some not so good moments. Definitely not on par with the one other significant female character here, namely Cotillard's, but overall she is alright. The conscience scene with the \"people\" looking at her with angry faces is among the most memorable of the entire film. How she pushes these huge mirrors in position to show us the concept of going deeper and deeper into the mind, layer by layer, was also really good. But the idea that she really joins the gang too is already difficult to believe, but her return and talk about utter creation make me almost forget about it. What I cannot forget, however, is her final idea to step down to the bottom layer where Watanabe's character is lost. They acted as if this layer was simply too tough to take and then minutes later they are like okay well no biggie, let's go there and fix everything. The real final antagonist, namely Hal (Cotillard), waiting there alone sure cannot justify their initial thoughts about that layer and its impact. As for Cotillard's character, of course the French music was a pretty telling inclusion again linked to her previous Oscar-winning movie for sure. Everybody who saw that one, must have made the connection. Anyway, speaking of Page's character again, kinda telling that she gets an implied romantic relationship with the kiss moment between her character and JGL's. That was one of the very few funny moments and that is fine. It was okay, but no need to stretch it or turn it into a romance movie. Nolan has many other, bigger strengths and I am glad he focused on these.Also in my showing, some people laughed at everything they got the chance to laugh at. It was pretty embarrassing. They knew nothing about movie quality. Anyway, Nolan's biggest strength here is the attention to detail. As good as the overall concept may be, the best thing is what he did with these small moments, such as the carpet having the wrong material and we realize it is just a dream within a dream. There are many other examples, such as everything involving Hardy's character too. He also brought in some comedy, like when he is that lady or when he guns down the enemy and tells JGL's character to think big. But the overall concept is just as good, the idea of how being killed in a dream makes you wake up, all the layers, or the idea how we do not remember the beginning of a dream (how did the two get there?) and a lot more. Nolan's script really oozes brilliance and creativity here and I would have been totally fine with it winning a fifth Oscar. Or even with the film winning Best Picture, which it admittedly never had a shot at. But the concept of dreaming and how little we and science know about it now in the 21st century is something that has fascinated me for a long time really, especially because I am a very heavy and intense dreamer myself. So exactly my cup of tea this movie and maybe people with little interest in the overall idea will like it less. Or maybe not, if we take a look at the really high rating here on imdb and this really high ranking up in the top250. Not undeserving. Nolan created a world of genius.At the same time, away from all the sci-fi, he also managed to create a touching story between Cobb and Hal. The scene when she jumps down from the roof is of course especially haunting, but also how we never see their children's faces in the dream because Cobb refuses to until he sees them in reality. And does so in the end. Happy end? Maybe. But to me it all felt so rushed with how he meets the old self of Watanabe's character (by the way the quote about how he simply bought the airline was another great comedic moment, maybe Nolan is not as bad as I thought and should finally make a 100% comedy movie), turns him into a young man again within seconds and they all wake up inside the plane and even Murphy's character makes his peace again with his old man. And finally Cobb can, thanks to the Asian's help, get back to America and see his kids and then we see the swirling totem. Hal's totem. Does that mean we are indeed in her dream still. It could be with Nolan poking fun at unrealistic (in the truest sense of the word) rushed endings and nothing we saw was reality. Was Hal right all along? That's the good thing here. There is no 100% right or wrong. No 100% true or false and even if you watch this film ten times, you will still find something new you have not come across before, something new that can help you develop new creative approaches to the film and the reality depicted therein. Also have you ever asked yourself if you are in a dream yourself because when you are dreaming, then you usually don't know, so who says it couldn't be one we are all in right now. Anyway, this should be almost enough now with the review. You hopefully understood how much I liked this film.Just a few more snippets of information: 2010 was an amazing year for DiCaprio because he also appeared in Scorsese's \"Shutter Island\", another brilliant movie about the distorted human mind. I just mentioned the idea of totems. That I like as well, also with the additional idea that you should not let anybody touch your totem and how Cobb puts Page's character to a bit of a test there. Oh yes, another really smart reference the 1:10 proportion. One hour of dreaming equals ten hours of action in our dreams, which is why reality got slower and slower the further they dove down and how they showed it to us with the car crashing down the cliff (another happy ending that they are all saved) in fragments of 10% of a second maybe with all that has been going on underneath in the meantime was another stroke of genius for sure. There is so much to like here, it is pretty unreal. I am generally not a huge action film fan, but the very action-packed sequence in the icy region was good too. What can I say? I just like snow. Even if they had preferred an island in the sun or so. Another comedic moment. Alright. I think I'll leave it at that, even if there are another dozen moments at least so full of wit and creativity (just like myself) that they deserve elaboration on, but I won't because you need to watch it yourself instead!"
    },
