      "helpful": "3 out of 5 found this helpful.",
      "title": "Matrix light",
      "content": "If you didn't like the Matrix, you might skip this one. Dicaprio is man who is an expert at entering dreams and extracting information for corporate espionage. He has a problem in that there is a price on his head. He is a wanted man. A Japanese business man wants Dicaprio to enter the mind of a competitor and place an idea in his head to break up his empire. In exchange Dicaprio (Dom Cobb) would be allowed to go home to his family. Cobb first gets an architect (Ellen Page) who can design a complex location, such as a dungeon master creating the stage. He then must assemble a team of people with different skills to navigate through the dream world.The beginning of the movie is a bit confusing as you don't know what is real and what is a dream. However this shortly clears up. Dom Cobb has a lot of issues concerning his past life and dreamworld which jeopardizes the mission. His dead wife keeps showing up to foil his plans and he just hasn't the heart to kill her. The dreamworld works like a narcotic. Once you go into it, reality becomes boring. This movie is more brilliant in its complexity and script than it is in entertainment, but it worked for me."
