    {
      "username": "jboothmillard",
      "userUrl": "https://www.imdb.com/user/ur4248714",
      "reviewLink": "https://www.imdb.com/review/rw2287305",
      "warningSpoilers": true,
      "date": "29 July 2010",
      "rate": "8",
      "helpful": "3 out of 24 found this helpful.",
      "title": "Inception",
      "content": "From BAFTA and Golden Globe nominated director Christopher Nolan (Memento, Insomnia, The Dark Knight), this to me and I'm sure millions of other people was a much anticipated summer blockbuster, and I wasn't going to miss it. Basically, Dominic 'Dom' Cobb (Leonardo DiCaprio) is a skilled thief who steals valuable secrets in dangerous extraction, he enters a person's subconscious in their dreams, when the mind is most vulnerable. He is troubled man however, haunted by the memory's of his past with wife Mallorie 'Mal' (Marion Cotillard) and their subconscious experiences, and he is dying to change his past via the dream state. Saito (Batman Begins' Ken Watanabe) is offering him the chance of redemption by carrying out one last job using the subconscious entry, an impossible mission called inception. This would involve entering the mind of Robert Fischer Jr. (Cillian Murphy), who has gained control of the company his recently deceased father Maurice (Pete Postlethwaite) owned, and placing in his mind the idea to shut down this company. So Cobb assembles a crack team of experts in the field of dream extraction and knowledge of inception, including Arthur ((500) Days of Summer's Joseph Gordon-Levitt), Ariadne (Juno's Ellen Page), Eames (Tom Hardy) and Yusuf (Dileep Rao). To make sure the mission can succeed they plan to go into a dream lasting ten hours, the length of Fischer's regular plane journey, and they will be going through three layers of dream state, i.e. Dream within a dream within a dream. So the main dream is Fischer and his assistant Peter Browning (Platoon's Tom Berenger) caught as hostages, and Fischer is convinced Browning is keeping something about his father from him. Then the next dream is Fischer convinced by Cobb that someone is trying to get into his head for this big secret, and he agrees to go into a dream to find out what the big secret is. Of course the dream states collide with each other, so the main dream sees some car chases as distractions in the big maze, so gravity for example of the characters in sleep will come into play in the other dreams too. But also the big problem with Cobb being in the dream is that his thoughts are being projected into the dream as well, such as the appearance of his wife and kids, his wife even kills Fischer when they need him most, forcing Cobb to go into his own memory of dream. In the end, the big secret placed into Fischer's mind is that his father wanted him to go his own way and create another company, and Cobb manages to come out with Saito as themselves, and the past is changed for Cobb for the better. Also starring Sir Michael Caine as Miles and Witness's Lukas Haas as Nash. There is a thought hanging over you when you watch that you really have to concentrate, but at the same time it is quite easy to keep up with where you are. If you can keep up with it, like I did manage to, you are completely taken in by the great action sequences, the well chosen cast, the imaginative concept, and the brilliant special effects to make it all possible, a fantastic and cool science-fiction action thriller. It won the Oscars for Best Cinematography, Best Sound Editing, Best Sound Mixing, and Best Visual Effects, and it was nominated for Best Motion Picture of the Year, Best Art Direction, Best Music, Original Score for Hans Zimmer, and Best Writing, Screenplay Written Directly for the Screen, it won the BAFTAs for Best Special Visual Effects, Best Production Design, and Best Sound, and it was nominated for Best Film, the Anthony Asquith Award for Film Music, Best Cinematography, Best Editing, and Best Original Screenplay, and it was nominated the Golden Globes for Best Motion Picture - Drama, Best Original Score, and Best Screenplay. Leonardo DiCaprio was number 94 on The 100 Greatest Movie Stars. Very good!"
    },
    {
      "username": "rmax304823",
      "userUrl": "https://www.imdb.com/user/ur0819382",
      "reviewLink": "https://www.imdb.com/review/rw2445568",
      "warningSpoilers": true,
      "date": "18 June 2011",
      "rate": "2",
      "helpful": "46 out of 91 found this helpful.",
      "title": "Mind Boggling.",
      "content": "Around 750, the renowned poet of the Tang dynasty, Li Po, is supposed to have asked, \"Last night I dreamed I was a butterfly. Today, am I a butterfly dreaming I am a man?\" Marcus Aurelius, the late Roman emperor and philosopher, wrote, \"Life is a dream, a little more coherent than most.\" Freud concluded that dreams were the fulfillment of unconscious wishes that had managed to sneak past the dozing censor. Aboriginal Australians believed in a real parallel universe called The Dream Time in which everything and everyone who ever existed, still existed, and anybody could enter this place during sleep.Modern psychology believes that dreams are nothing more than random cortical bombardment caused by a lot of activity in sub-cortical structures associated with the filing of memories, and the cortex goes into overdrive trying to make narrative sense of them. Sex dreams are pleasant enough except when the furry little animals show up, but statistics demonstrate that the majority of dreams are truly lousy, the kind we can easily live without. Don't you get tired of running in slow motion through a swamp while being chased by an ogre? Does all this sound like pointless rambling to you? Well, then you're not going to enjoy \"Inception\" because it meanders at lightning speed all over the place and lives by no rules that human beings have ever known.On the other hand, if you find these adventitious allusions in some way interesting, then you should see this dark and muddled movie. You get a bonus too, because in its style it closely resembles an action movie from the 1980s. Everything is happening all at once -- or maybe not all at once. Who cares? The point is that people get shot in the forehead and buildings comes toppling down for no reason and slow-motion explosions take place at irregular but short intervals.I'm getting pretty tired of seeing films that use some bewildering metaphysical scheme as an excuse to show off still more CGIs. I couldn't watch this thing through."
    },
    {
      "username": "Tweekums",
      "userUrl": "https://www.imdb.com/user/ur13977076",
      "reviewLink": "https://www.imdb.com/review/rw2413797",
      "warningSpoilers": true,
      "date": "15 April 2011",
      "rate": "10",
      "helpful": "1 out of 17 found this helpful.",
      "title": "Dreams within dreams",
      "content": "Often when one is told that a film is amazing it is a disappointment even if it is a decent film; that isn't the case here though; for me this film really did live up to the hype! Leonardo DiCaprio plays Cobb, a man who goes into other people's dreams to steal their secrets. One day a man approaches him with a far more difficult proposition; he wants an idea planted in the mind of a business rival; an idea the man must think was his own. Cobb is initially less than keen to do the job but the man has promise that he can arrange for him to get home to his children; something he can't currently do because he is suspected of killing his wife. To do the job he must assemble a team and take his target into a dream designed my new recruit Ariadne. This is no ordinary dream though; it requires the team to enter a dream within a dream within a dream! It is complicated further by the facts that his dead wife haunts Cobb and that if any of them die in the dream they will be trapped in a limbo.Director Christopher Nolan ably demonstrates that a big blockbuster film doesn't need to be in 3D these days nor does it need to be devoid of complicated ideas to succeed. DiCaprio did a fine job as Cobb and it was nice to see the excellent Ellen Page playing somebody who wasn't still a schoolgirl! While this film was about ideas that doesn't mean it wasn't full of spectacular special effects; while many of them were clearly computer generated they looked real enough to enable the viewer to suspend their disbelief in a way that often isn't possible. The idea of dreams within dreams could have been very confusing but each dream was very different so the viewer doesn't forget which layer of the dream is which once the action begins. If you have being putting off watching this film because you have been put off by the hype don't worry and watch it now; it is great."
    },
